mapper.select:

select 

from TTLMQOrders
where MQDateTime = #{mqdatetime,jdbcType=TIMESTAMP}
  and HostName = #{hostname,jdbcType=VARCHAR}
  and OrderRefID = #{orderrefid,jdbcType=VARCHAR}

mapper.delete:

delete from TTLMQOrders
where MQDateTime = #{mqdatetime,jdbcType=TIMESTAMP}
  and HostName = #{hostname,jdbcType=VARCHAR}
  and OrderRefID = #{orderrefid,jdbcType=VARCHAR}
